}

- (void)viewDidLoad {
    [super viewDidLoad];
    
     scrollView = [[UIScrollView alloc] initWithFrame:self.view.frame];
    
    scrollView.contentSize = CGSizeMake(self.view.frame.size.width, 4000);
    
    [self.view addSubview:scrollView];
    

   
   self.interval = [NSTimer scheduledTimerWithTimeInterval:0.5 target:self selector:@selector(test) userInfo:nil repeats: YES];
    
    [[NSRunLoop mainRunLoop] addTimer:self.interval forMode:NSRunLoopCommonModes];
    [self.interval fire];
    // Do any additional setup after loading the view, typically from a nib.
}

